import React from "react";

import { BrowserRouter as Redirect, Route } from "react-router-dom";

const PrivateRoute = function({def,isAuth,...rest}){
    if(isAuth()){
    return <Route
        {...rest}
    />
    }
    else{
        return def();
    }
}

export default PrivateRoute;
